import {BrowserRouter, Routes, Route} from 'react-router-dom';
import './css/App.css';
import Header from './components/Header';
import Sidebar from './components/Sidebar/Sidebar';
import Profile from './components/Profile/Profile';
import Dialogues from './components/Dialogues/Dialogues';
import News from './components/News/News';
import Music from './components/Music/Music';
import Settings from './components/Settings/Settings';
import Footer from './components/Footer';

const App = (props) => {
  return (
    <div className='app-wrapper'>
      <Header />
      <BrowserRouter>
        <Sidebar state={props.appState.sidebar} />
        <div className='content'>
          <Routes>
            <Route path='/messages' element={ <Dialogues state={props.appState.pageDialogues} /> } />
            <Route path='/profile' element={ <Profile state={props.appState.pageProfile} addPost={props.appState/addPost} /> } />
            <Route path='/news' element={ <News /> } />
            <Route path='/music' element={ <Music /> } />
            <Route path='/settings' element={ <Settings /> } />
          </Routes>
        </div>
      </BrowserRouter>
      <Footer />
    </div>
  );
}

export default App;
